import React from "react";
import { Table } from "react-bootstrap";

function Tabla(props) {
  
  return (
    <Table>
      <thead>
        {props.contenido}
      </thead>

      <tbody>
        <tr>
          <td>1</td>
          <td>2</td>
          <td>3</td>
          <td>4</td>
          <td>5</td>
        </tr>
      </tbody>
    </Table>
  );
}

export default Tabla;
